package com.mycallstation.external.ipkall;

/**
 * @author wgao
 * 
 */
public class IPKallException extends Exception {
	private static final long serialVersionUID = -7103790282041515667L;

	public IPKallException() {
		super();
	}

	public IPKallException(String message) {
		super(message);
	}

	public IPKallException(Throwable cause) {
		super(cause);
	}

	public IPKallException(String message, Throwable cause) {
		super(message, cause);
	}
}
